create database miku_40k

use miku_40k;

create table roles (
id int auto_increment primary key,
name varchar(255)
);

INSERT INTO roles (name) VALUES ('user_common'), ('seller'), ('admin');

CREATE TABLE usuarios (
    id INT AUTO_INCREMENT PRIMARY KEY,
    username VARCHAR(50) NOT NULL UNIQUE,
    email VARCHAR(100) NOT NULL UNIQUE,
    password VARCHAR(255) NOT NULL,
    role_id INT,
    FOREIGN KEY (role_id) REFERENCES roles(id) ON DELETE SET NULL
);

insert into usuarios (username, email, password, role_id)
values ('coco', 'a@a', 'zapato', '1');

CREATE TABLE productos (
    id INT AUTO_INCREMENT PRIMARY KEY,
    name VARCHAR(100) NOT NULL,
    description TEXT,
    price DECIMAL(10, 2) NOT NULL,
    image_base64 LONGTEXT,  -- Almacena la imagen en formato base64
    seller_id INT,
    FOREIGN KEY (seller_id) REFERENCES usuarios(id) ON DELETE CASCADE
);

INSERT INTO productos (name, description, price, image_base64, seller_id)
VALUES ('Miku_test','Miku de prueba', 5.99, 'data:image/jpeg;base64,', 1);

CREATE TABLE carrito_compras (
    id INT AUTO_INCREMENT PRIMARY KEY,
    user_id INT,
    product_id INT,
    quantity INT DEFAULT 1,
    FOREIGN KEY (user_id) REFERENCES usuarios(id) ON DELETE CASCADE,
    FOREIGN KEY (product_id) REFERENCES productos(id) ON DELETE CASCADE
);



select * from  usuarios;
select * from productos;

drop database miku_40k
